import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <div className="Title">
        <h1>RANGER</h1>
        <br />
        <div className="Title-Subtitle">it's dangerous to go alone!</div>
        </div>
    );
}

export default Header;
